import React from 'react';
import {NavLink} from "react-router-dom";
import classes from './DevIos.module.css'
import iosapp from '../../img/img_slider.png'
import s from "../Home/Block3/Block3.module.css";






let DevIos=(props) =>{


    return(

        <div className={classes.block1}>
            <div className={classes.item_text1}>
                <span className={classes.h1}>ios app</span><br/>
                <span className={classes.h1Small}>development</span><br/>
                <span className={classes.textInfo}> <a href="#"> SparkleAppz</a>  have experience of more than 10 years in making world’s leading brands go mobile by developing inspiring apps in Apple platform. Add boost to your business needs by using our expertise in<a href="#"> iOS app development </a> to build beautiful,<a href="#"> engaging</a>  and <a href="#">seamless </a>  app.</span>
                <br/>
                <a href="/portfolio"> <button className={classes.btn}>Our Portfolio <b> &#8594;</b></button></a>
            </div>
            <div className={classes.item_img1}>
                <img src={iosapp} alt=""/>
            </div>

            <div className={classes.blockBlue}>
                <div className={classes.item}>
                    <h1>GLIMPSE OF WORK</h1>
                    <span className={classes.span}>We have a reputation to deliver services that are cost effective, yet quality oriented that customer expects. We have delivered beautiful, functional and fun to use apps that mesh with customer’s personal vision. Our solutions are known to be reliable and focused on customer’s business needs.

We have designed advanced and beloved Apple iOS apps in a range of genres. Not only our applications pass Apple’s strict approval process, but they have also gone on to find audiences on countless iPhones and iPads around the globe.</span>
                </div>
            </div>



        </div>

    );


};




export default DevIos;
